        "Desc": "异常的雷元素生命。虽然外貌上与纯水精灵有相似之处，却不具备她的智慧与记忆。\n驱动雷音权现的是更为原始纯粹的愤怒。\n据说这种生物只会随着雷霆降生在遗留着强大忿恨的地方，譬如说支离破碎、雷云黝黝的天云峠。只要土地中的怨恨不消，那雷鸣也不会断绝吧。",
