        "Desc": "这种发条机关的设计目的为搜寻、驱逐、消灭对水下设施有不利影响的水生动物。\n自第一次涨水期以来，枫丹科学院便一直忧心于或许有一天终将发生的第二次涨水期。其中一部分人开始构想收复丧失在水中的遗迹并建设海底之城，另一部分人则望着永远浮在不可触及高度的空中岛屿，梦想天空的都会。\n「水下巡游型」来自前者，但从结果而言，近些年后者似乎取得了上风。",
