        "Desc": "基于「谢尔比乌斯式」，进行了调整的发条机关。很遗憾，并不具备攻击以外的能力。\n基于湮灭能量的发条机关通常会利用特殊晶体构成的中继器从枫丹的环境中提炼荒性与芒性产生能量，但在枫丹以外的区域也能通过预先准备的能量块进行短程短时的行动。这两者的区别体现在机关上晶体部件的形状。",
