        "Name": "镀金旅团 · 炽沙叙事人",
        "Title": [
            "编织烈焰与史诗的神谕"
        ],
        "Desc": "从沙漠中走出的松散佣兵团体中的一员。即使为了报酬愿意为任何人效力，也不会忘记沙海中的根源。\n在文明崩解之后，沙漠中的故事如同风中的火星、云中的雨一样，是经由口口相传的诗与秘史一代又一代继承下去的。在流传的过程中有许多故事变化了，又有许多故事失落了。\n「镀金旅团」是无知或是怀着蔑视的心不去区分沙海中诸多部族的外人对他们的统称。在被称为镀金旅团的人当中，有许多人已经忘记了沙漠的故事。如今仍然能记起许多故事的人，是不会背叛流淌在体内的沙漠血脉的。",
