        "_id": 60507,
        "Name": "深海龙蜥 · 啮冰",
        "Title": [
            "珊瑚的守护者"
        ],
        "Desc": "生活在海渊之下的龙蜥。因为社会分工，而出现了冰元素的形态。\n人类的到来引发了对抗，深海龙蜥开始了进化。正如蚂蚁会因性别和分工不同，而产生不同形态。这些龙蜥比起普通深海龙蜥更加强大。",
        "Color": "Ice",
        "HP": 6.0,
        "HPCurve": 2,
