        "Desc": "漆黑之力凝成的魔龙。\n被称为深渊浮灭主亦被称为「古斯托特」的虚界魔物，拥有侵蚀地脉之中的回忆并将之凝聚为实体的如同灾厄的权能。而在大地之下，亘古流涌的诸多过往之中，原初元素龙王残留的意志被如髓抽出，构成了拟造形象的基底。\n然而那真的只是单纯的「形象」吗，借由曾经抵抗的异界之力再度睁眼的已死之龙，如梦一般在短暂的甦生中舍弃了一切。漆黑的福音令其永困于生命的最后一日，无穷的怒火吞没所有的理智，此刻，唯有战意不遑宁息，燃烧不止。",
