        "Desc": "穿过深黯的裂隙，自异界侵入此世的深渊魔物。\n曾有古代的贤哲将人类定义为无羽毛的二足走兽，意图以此区分人与无智性的野兽，进而证明灵长的优越性。从某种意义上来说，这些逡巡于寂灭的星海间、身披鳞片而非羽毛的不灭之物，这些如垂钓者般投下钩喙、攫噬各个世界生物质的无名钓客，或许同样符合这般粗浅的「人」的定义。",
