    "3023": [
        {
            "I": [
                "UI_Tutorial_144"
            ],
            "D": "来自沙漠的古代机械，与遗迹机关有着显著的区别。在战斗中，元能构装体会将其元件投射出去，核心会进入「不可视」状态，隐身并且提升伤害抵抗能力。<color=#FFE14BFF>使激化反应波及其核心，或是在元件被破坏后恢复期间利用雷元素攻击</color>，能够破除元能构装体的不可视状态，并使其进入超频过载的瘫痪状态。"
        }
    ],
    "3024": [
        {
            "I": [
                "UI_Tutorial_145"
            ],
            "D": "来自沙漠的古代机械集合体，拥有现今文明无法理解的特性。在战斗中，半永恒统辖矩阵会将其元件投射出去，核心会进入「不可视」状态，隐身并且大幅提升伤害抵抗能力。<color=#FFE14BFF>使激化反应波及其核心，或是在元件被破坏后恢复期间利用雷元素攻击</color>，能够破除半永恒统辖矩阵的不可视状态，并使其进入超频过载的瘫痪状态。如果长时间无法破除核心的不可视状态，半永恒统辖矩阵会施展威力强大的超频冲击…"
        }
    ],
