    "3079": [
        {
            "I": [
                "UI_Tutorial_214"
            ],
            "D": "至今仍在纳塔各处徘徊，却不知目的为何的古老机械造物。在角色进入和维持「夜魂加持」状态时，秘源机兵 · 寻捕械会积累「应战对策」的进度。在「应战对策」的进度积累满后，秘源机兵 · 寻捕械将会释放特殊的集束激光。不过，所谓风险和机遇并存，说不定也可以抓住机会对它造成大量伤害…"
        }
    ],
    "3081": [
        {
            "I": [
                "UI_Tutorial_216"
            ],
            "D": "历经无数了不起战斗的匿叶龙，并非异种，只是因为贪食而长成现在的样貌。会在战斗过程中收取火榴果并吐出作为炸弹进行攻击。不过，如果在被贪食匿叶龙山王吞进去之前，就用<color=#FFE14BFF>火元素引爆火榴果</color>，会发生什么样的事呢…"
        }
    ],
    "3080": [
        {
            "I": [
                "UI_Tutorial_215"
            ],
            "D": "因自身无法承担的伟力折磨，而具有超然形体的异种绒翼龙。会在战斗中飞入高空，转化为力量汇聚的「金焰」形态，为自身创造护罩，并向地面发射唤来热风的「炽风翎羽」。如果无法在它俯冲至「炽风翎羽」前将后者破坏，它就会借由燃素风场重新返回空中，直到力竭转化回原有的形态为止。看来，在它向下俯冲前用<color=#FFE14BFF>能与火元素反应的元素破坏「炽风翎羽」</color>，或许是击败它的关键…"
        }
    ],
    "3075": [
        {
            "I": [
                "UI_Tutorial_212"
            ],
            "D": "纳塔各个部族所信仰的「大灵」借由黑曜石图腾的形象如斯显化。战斗中，大灵显化身会在一段时间内张开「领域 · 试炼之刻」，为自己创造护盾，并持续吸收领域内队伍中所有角色的元素能量。领域内的角色造成的伤害将大幅提高。<color=#FFE14BFF>在领域结束前破除护盾</color>，则将获得返还的大量元素能量，若无法破除，大灵显化身会根据剩余护盾的量生成元素护罩。"
        }
    ],
